package packageajay;

public class Swap2Nos {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
  
		int n1 = 10;
		int n2 = 20;
		System.out.println(n1);
		System.out.println(n2);
		int a = n1;
		    n1=n2;
		     n2=a;
		 
		 System.out.println(n1);
		 
		 System.out.println(n2);
	}

}
